import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { ThemeProvider } from './context/ThemeContext';
import { Header } from './components/Header';
import PreloadAssets from './components/PreloadAssets/PreloadAssets';
import TransactionFeed from './components/MainSection/TransactionFeed';
import FAQ from './components/MainSection/FAQ';
import Newsletter from './components/MainSection/Newsletter';
import Footer from './components/MainSection/Footer';

// Import global styles
import './assets/css/bitrader-core.css';
import './assets/css/bitrader-custom.css';
import './index.css';

function App() {
  return (
    <ThemeProvider>
      <PreloadAssets>
        <Router>
          <Header />
          {/* Main Section Components */}
          <main>
            <TransactionFeed />
            <FAQ />
            <Newsletter />
          </main>
          <Footer />
        </Router>
      </PreloadAssets>
    </ThemeProvider>
  );
}

export default App;
